UPDATE locales_quest SET details_loc4='While some of our soldiers are busy capturing wolves for the stable master, others must provide for the simple necessities that riding requires. I am speaking of riding harnesses, of course.$B$BYou must strike at the indigenous rams of the region. The very same rams that the Stormpike cavalry uses as mounts!$B$BSlay them and return to me with their hides. Once we have gathered enough hides, we will fashion harnesses for the riders. The Frostwolf Wolf Riders will ride once more!', objectives_loc4='null',, offerrewardtext_loc4='Well done, soldier. I will notify you when I have stockpiled enough of the hides.$B$BCarry on!' WHERE entry=7002; -- details: While some of our soldiers are busy capturing wolves for the stable master, others must provide for the simple necessities that riding requires. I am speaking of riding harnesses, of course.$B$BYou must strike at the indigenous rams of the region. The very same rams that the Stormpike cavalry uses as mounts!$B$BSlay them and return to me with their hides. Once we have gathered enough hides, we will fashion harnesses for the riders. The Frostwolf Wolf Riders will ride once more! -- objectives: null -- offerrewardtext: Well done, soldier. I will notify you when I have stockpiled enough of the hides.$B$BCarry on!
