UPDATE locales_quest SET details_loc4='<Warmaster Laggrond salutes you.>$B$BIt is your time, $N. You have done much for the Frostwolf Clan and in doing so, earned a place as not only a soldier of Frostwolf but also as a friend.$B$BWell done! Present your initiate\'s insignia.$B', offerrewardtext_loc4='This new insignia reflects your rank amongst the Frostwolf. Keep it on you at all times.$B$BAnd mage... Die with honor!' WHERE entry=7163; -- details: <Warmaster Laggrond salutes you.>$B$BIt is your time, $N. You have done much for the Frostwolf Clan and in doing so, earned a place as not only a soldier of Frostwolf but also as a friend.$B$BWell done! Present your initiate\'s insignia.$B -- offerrewardtext: This new insignia reflects your rank amongst the Frostwolf. Keep it on you at all times.$B$BAnd mage... Die with honor!
