UPDATE locales_quest SET details_loc4='It is good to see you again, $C. I had not expected you to return. Alas, you have proven yourself a brave and honorable soldier of the Frostwolf.$B$BYour time has come again, $N. You have earned a new ranking and as such, a new insignia denoting this rise in stature.$B$BPresent your insignia.', offerrewardtext_loc4='<Warmaster Laggrond salutes.>$B$BGo, $N! Continue your defense of the Frostwolf. This war must be won! For Drek\'Thar! For the Warchief!' WHERE entry=7164; -- details: It is good to see you again, $C. I had not expected you to return. Alas, you have proven yourself a brave and honorable soldier of the Frostwolf.$B$BYour time has come again, $N. You have earned a new ranking and as such, a new insignia denoting this rise in stature.$B$BPresent your insignia. -- offerrewardtext: <Warmaster Laggrond salutes.>$B$BGo, $N! Continue your defense of the Frostwolf. This war must be won! For Drek\'Thar! For the Warchief!
