UPDATE locales_quest SET details_loc4='I seek the Paragons of Power known as the Coins of the Tribes.  They are the currency used by the various denizens of Zul\'Gurub, and each is imbued with subtle but powerful mojo.$B$BThere are nine distinct kinds to be found.  Some are sought after by my compatriots for various armors they offer Zandalar heroes.  Should you have any extra, I will trade you one of our Honor Tokens for a set of three.  You may use the Tokens with Rin\'wosho the Trader; he offers our heroes special items for them.', offerrewardtext_loc4='Excellent - this set of coins will make a fine addition to our growing collection... one that we will use in the tribe\'s defense against the rise of the Blood God. You\'ve earned this Honor Token, $N, as well as the thanks of the tribe!' WHERE entry=8195; -- details: I seek the Paragons of Power known as the Coins of the Tribes.  They are the currency used by the various denizens of Zul\'Gurub, and each is imbued with subtle but powerful mojo.$B$BThere are nine distinct kinds to be found.  Some are sought after by my compatriots for various armors they offer Zandalar heroes.  Should you have any extra, I will trade you one of our Honor Tokens for a set of three.  You may use the Tokens with Rin\'wosho the Trader; he offers our heroes special items for them. -- offerrewardtext: Excellent - this set of coins will make a fine addition to our growing collection... one that we will use in the tribe\'s defense against the rise of the Blood God. You\'ve earned this Honor Token, $N, as well as the thanks of the tribe!
